import React, { useState, useEffect } from 'react';
import { getUsers, saveUsers } from '../utils/LocalStorageService';
import { Link } from 'react-router-dom';
import '../styles/LoginPage.css';

const LoginPage = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');

  useEffect(() => {
    const users = getUsers();
    console.log('Initial Users:', users);
    if (users.length === 0) {
      const defaultUsers = [
        { id: 1, name: 'Admin User', email: 'admin@example.com', role: 'admin', password: 'admin123' },
        { id: 2, name: 'Host User', email: 'host@example.com', role: 'host', password: 'host123' },
        { id: 3, name: 'Interviewer', email: 'interviewer@example.com', role: 'host', password: 'interview123' },
        { id: 4, name: 'Director', email: 'director@example.com', role: 'host', password: 'director123' },
        { id: 5, name: 'HR', email: 'hr@example.com', role: 'host', password: 'hr123' },
        { id: 6, name: 'Manager', email: 'manager@example.com', role: 'host', password: 'manager123' },
        { id: 7, name: 'CEO', email: 'ceo@example.com', role: 'host', password: 'ceo123' }
      ];
      saveUsers(defaultUsers);
      console.log('Default Users Added:', defaultUsers);
    }
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    setError('');
    const users = getUsers();
    console.log('Users:', users);
    console.log('Entered Email:', email);
    console.log('Entered Password:', password);
    const user = users.find(u => u.email.toLowerCase() === email.toLowerCase() && u.password === password);
    if (!user) {
      setError('Invalid email or password');
      console.log('No matching user found');
      return;
    }
    localStorage.setItem('token', 'dummy-token');
    localStorage.setItem('role', user.role);
    localStorage.setItem('name', user.name);
    console.log('Login Successful:', user);
    window.location.reload();
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('role');
    localStorage.removeItem('name');
    window.location.reload();
  };

  return (
    <div className="loginpage-outer">
      <nav className="navbar">
        <div className="navbar-logo">Visitor Management</div>
        <ul className="navbar-links">
          <li><Link to="/">Home</Link></li>
          <li><Link to="/products">Products</Link></li>
          <li><Link to="/resources">Resources</Link></li>
          <li><Link to="/aboutus">About Us</Link></li>
          <li><Link to="/bookademo">Book a Demo</Link></li>
          <li><Link to="/contactus">Contact Us</Link></li>
          <li><Link to="/login" className="login-btn">Login</Link></li>
        </ul>
      </nav>
      <div className="login-container">
        <h2 className="login-title">Login</h2>
        <form className="login-form" onSubmit={handleSubmit}>
          <div>
            <label>Email:</label><br />
            <input type="email" value={email} onChange={e => setEmail(e.target.value)} required />
          </div>
          <div>
            <label>Password:</label><br />
            <input type="password" value={password} onChange={e => setPassword(e.target.value)} required />
          </div>
          {error && <p className="login-error">{error}</p>}
          <button type="submit">Login</button>
        </form>
        {localStorage.getItem('token') && (
          <div className="login-logout">
            <button onClick={handleLogout}>Logout</button>
          </div>
        )}
      </div>
    </div>
  );
};

export default LoginPage;
